// src/components/Cart.js
import React from 'react';

const Cart = ({ cartItems }) => {
  return (
    <div>
      <h2>Your Cart</h2>
      {cartItems.map((item, index) => (
        <div key={index}>
          <h3>{item.title}</h3>
        </div>
      ))}
    </div>
  );
};

export default Cart;
